function getview(id){
    $.ajax({
        url: "/Home/ViewDetailsPartial?eventid="+id,
        type: "GET",
        cache: false,
        success: function (result){
            $("#viewdetailsofevent").html(result)
            console.log(id)
            openNav()
            getviewmapdata(id)
        },
        error: function (){
            console.log("error")
        }
    });
}
function getviewmapdata(id){
    $.ajax({
        type: "GET",
        url: "/Home/getviewdata?eventid="+id,
        dataType: "json" ,
    }).done(function (data){
        console.log(data)
        loadsmallmap(data)
    })
}
